import Vue from 'vue'
import Home from '@/views/Home.vue'
import Router from 'vue-router'

Vue.use(Router)

export const constantRouterMap = [
    {
        path: '/',
        component: Home,
        children: [
            {path: '/', component: () => import('@/views/Home.vue')},
        ]
    }
]

const router = new Router({
    routes: constantRouterMap
})

export default router
